import "./App.scss";
import React from 'react'
import Navbar from "./components/Navbar";
import Slide from "./components/Slide";
import Datas from "./components/Datas";

export const RefContext = React.createContext<any>();

function App() {
  const HomeComponentRef = React.useRef<HTMLDivElement | null>(null);

  return (
    <div className='App'>
      <RefContext.Provider value={HomeComponentRef}>
        <Navbar />
        <Slide />
        <hr style={{ color: "white", border: "5px", marginTop: "60px" }} />
        <Datas />
        <div style={{ width: "100%", height: "400px" }}></div>
      </RefContext.Provider>
    </div>
  );
}

export default App;
